function SessionLength({ setSessionTime, sessionTime }) {

    const incrementTime = () => {
        setSessionTime(sessionTime + 60)
    }

    return (
      <div id="session-length">
        <h2 id="session-label">Session Length</h2>
        <button className="border border-black rounded m-2" id="session-increment" onClick={incrementTime}>Session Up</button>
        <button className="border border-black rounded m-2" id="session-decrement">Session Down</button>
      </div>
    )
}
export default SessionLength;
